import React from "react";
import "./Checkout.css";

function Checkout() {
  return (
    <div className="checkout">
      <div className="checkout_left">
          <img src="https://images-na.ssl-omages-amazon.com/images/G/02/UK_CCMP/TM/OCC" alt="" className="checkout_ad"/>
      </div>
    </div>
  );
}

export default Checkout;
